icking on a link in an email. This model provides higher-quality and targeted leads, since the user confirms their desire to receive content or services with their action."]},{"question":"What is KPI?","answer":["KPI (Key Performance Indicators) are the advertiser\'s requirements for traffic, which are used to assess its quality and payback. The conditions under which traffic will be paid are specified in each offer.",["$","br",null,{}],["$","br",null,{}],"Fulfillment of the established KPIs can affect the improvement of cooperation conditions, such as the size of payments, access to exclusive offers or the provision of additional bonuses."]},{"question":"What is the test limit (Cap)?","answer":["When you first start working with any offer, you need to pass the qualification so that your traffic is recognized by the advertiser as high-quality. To do this, you need to bring a limited number of conversions to the offer in test mode - they are called a test limit.",["$","br",null,{}],["$","br",null,{}],"When the test limit is reached, you need to stop the traffic and inform your personal manager about it.",["$","br",null,{}],["$","br",null,{}],"If your traffic is approved, a payment will be scheduled for it in the next week. Then, after agreement with the advertiser, you can launch advertising campaigns again."]}]},{"title":"Technical questions","items":[{"question":"What should I do if I have technical problems?","answer":["If you have any technical issues, please contact our support team at"," ",["$","a",null,{"target":"_blank","rel":"noopener","href":"mailto:support@TrafficTrend.com","children":"support@TrafficTrend.com"}],". We will promptly process your request and make every effort to resolve the issue."]},{"question":"What is Postback?","answer":"Postback is a URL that allows the CPA network to receive automatic notifications from the advertiser about the user performing a target action (for example, a purchase or registration). This allows you to track conversi